import React from 'react';
// import sections
import GenerationSection from '../components/sections/GenerationSection';
import VocabSection from '../components/sections/VocabSection';

const Home = () => {
  return (
    <>
      <GenerationSection />
      <VocabSection />
    </>
  );
}

export default Home;
